import { useState } from 'react';
import s from './Header.module.css';

import HeaderModal from './HeaderModal';



const HeaderMobile = () => {

    const [isOpen, setOpen] = useState(false);

    const openModal = () => {
        setOpen(!isOpen);
    }

    console.log(isOpen);

    return (
        <>
            <div className={s.logo} onClick={openModal}>

                <p>LOGO</p>

            </div>
            {isOpen == true &&
            
                <HeaderModal />
            }
        </>
    );
}

export default HeaderMobile;
